import React, { Component } from 'react';

class landdingTable extends Component {
    render() {
        return (
            <div className="col-4-border">
                <div className="row">
                    <div className="col-9">
                        <header>{this.props.playlistTitle}</header>
                        <p>Quantity: 1/n </p>
                    </div>
                </div>
                <ul className="list-group" style={{ height: "430px", overflowY: "auto", overflowX: "hidden" }}>
                    <li>ABC</li>
                    <li>ABC</li>
                    <li>ABC</li>
                    <li>ABC</li>
                </ul>




                <div>Đây là footer</div><br />
            </div>
        );
    }
}

export default landdingTable;
